加到最低位，不断向前进位。

```rust
impl Solution {
    pub fn plus_one(digits: Vec<i32>) -> Vec<i32> {
        let mut res = Vec::new();
        let mut val = digits.last().unwrap() + 1;
        res.push(val % 10);
        val /= 10;
        for v in digits.into_iter().rev().skip(1) {
            val += v;
            res.push(val % 10);
            val /= 10;
        }
        if val > 0 {
            res.push(val);
        }
        res.into_iter().rev().collect()
    }
}
